ed as a junior auditor in KPMG France. I had the opportunity to work in different areas like Insurance and Industry.\nThanks to these internships, I improved my technical skills in accounting, cost-controlling, financial analysis and in project management. \n\nMoreover, I appreciated working for both start-ups and multinational companies that gave me the opportunity to evoluate in dynamic, thrilling and international environments. \n\nBallet is my hobby: I have practicing this sport for 17 years both in Conservatories and in Private Schools. I participated in many events (musicals, dancing ballets, movies), and sometimes with dancers of The Opera of Paris. I still live this passion through my School of Management.\nThen, I commited myself as a volunteer for student and sports organisations like Triathlon La Baule.','Sèvres','France',NULL,NULL,NULL,NULL,NULL,'https://lh5.googleusercontent.com/-078HdQrZAlQ/AAAAAAAAAAI/AAAAAAAAAKw/VZfwCue719k/photo.jpgsz=200','discover new things','Female','1992-05-08T22:00:00.000Z',0,'',0,'','102136470788970808580','ya29.CjHcAk3sR-vRrxcc8WKVeUthtXNfBauX1Hr5XJbIjK_B7Kwr29qBjAHEqALqhcAPlqLa','','2016-05-08 19:59:36','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914654/default_cover/photo-1445966275305-9806327ea2b5.jpg',10,'https://lh5.googleusercontent.com/-078HdQrZAlQ/AAAAAAAAAAI/AAAAAAAAAKw/VZfwCue719k/photo.jpgsz=200','Alexia.Chuzeville','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914654/default_cover/photo-1445966275305-9806327ea2b5.jpg'),(295,'Anna','Souakri',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBACJcEIVQwZB64pb1w0ENlVm0HZBjc2mgaxZCp7vCOSOMAZBQjizKo081muBnHs6yvbJNqTVKF2WUcObygN7LcDlr2U5wbAR3HPwkXFCTKqpc2A2TtrEGZAZCNwYbzUeF4ApxpFIaONZCFBvTRG6xQCQYWJEbOPqWgZDZD',NULL,'female',NULL,1161695763849537,'EAAG7LqtfGXYBACJcEIVQwZB64pb1w0ENlVm0HZBjc2mgaxZCp7vCOSOMAZBQjizKo081muBnHs6yvbJNqTVKF2WUcObygN7LcDlr2U5w