om/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914647/default_cover/photo-1424746219973-8fe3bd07d8e3.jpg'),(361,'Viktor','Futó',NULL,'My dream is to simplify the way how we perceive informations and comprehend the knowledge.\n\nI\'ve been doing the research, testing and working on it for more than 3.5 years. I\'ve made a few different applications that I\'ve tested, but it wasn\'t good enough. In my research I went through graph theory, predicate logic, ontology, knowledge representation, data mining and all of that in a context of UX usability while in the same time learning and coming into touch with Django, Backbone, Ruby on Rails, Neo4j, Node.js, MongoDB, Angular.js, Dart...\n\nRecently, I\'ve been approved and supported with my efforts to exosphe.re academy which takes place in Chile during summer of 2016 where I plan to work on it extensively and share my knowledge with people who are trying to solve similar problem.\n\nIf you admire the beauty of the knowledge and you would like to participate, you are free to join the party and write or add me on social media.\n\nOr if you have the same dream and you\'re already up to something, it would be an honor for me to join yours.\n\nSome of drafts:\nhttp://brainec.com/folders/68/canvas\nhttp://latexpen.io','Prague','Czech Republic',NULL,NULL,NULL,NULL,NULL,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAJS9ZBeKn9qRgDF812HPPqZAKA7EhRgIzQkfbKIZActwVa4L0WARYLk22pRYZAyJ0gQ9sKgddHLy9pkEtIy7YtdTi8fNgF2WlRoBmIhHLFH2TMjxwmB2WRYHUK61JXT95ZBrg5CvOiPzJGAicF7sZD','discover new things','Male','1993-11-07T23:00:00.000Z',1070135219712345,'EAAG7LqtfGXYBAJS9ZBeKn9qRgDF812HPPqZAKA7EhRgIzQkfbKIZActwVa4L0WARYLk22pRYZAyJ0gQ9sKgddHLy9pkEtIy7YtdTi8fNgF2WlRoBmIhHLFH2TMjxwmB2WRYHUK61JXT95ZBrg5CvOiPzJGAicF7sZD',0,'','','','','2016-05-14 12:58:19','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463230965/hiu8ocdckxmk1gziaxs2.jpg',5,'https://graph.facebook.com/me/picture?width=200&height=200&access