 Michigan (a suburb in Metro Detroit) when I was 3 years old. I learned English through rap music and have since had a keen interest in hip-hop culture.\nI now attend Washington University in St. Louis, studying Marketing and Computer Science.\nBeing able to listen to the stories of the affluent community of south of the Delmar Divide, as well as having a strong belief in giving back to those who have less (\"Noblesse Oblige\"), has enabled me to find my true purpose. My purpose is to provide the connection between those who have and those who don\'t.\nIn May of 2016, I started The Feedback Loop - an initiative that seeks to break the Delmar Divide through entrepreneurship in the arts. We provide solutions for those who seek to burgeon into the millennial market by creating curated media content (music & film) with local talent.','University city','United States',NULL,NULL,NULL,NULL,NULL,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBABHGwgNwmSnGHCqOkUyBnfyJYVWNSIdfezL6CMZAHenEFiGjZCsZB2ZAmh7KPdkbh2wpepY9fJLLmRV9Qet4KA2VM8FnidM61tCwIdjZAPBCQV01eyjn5YtVzVeoO8ZCZABKfPrMv88LZClIj4BPwYcZD','find teammates','Male','1996-09-04T05:00:00.000Z',10210008521993828,'EAAG7LqtfGXYBABHGwgNwmSnGHCqOkUyBnfyJYVWNSIdfezL6CMZAHenEFiGjZCsZB2ZAmh7KPdkbh2wpepY9fJLLmRV9Qet4KA2VM8FnidM61tCwIdjZAPBCQV01eyjn5YtVzVeoO8ZCZABKfPrMv88LZClIj4BPwYcZD',0,'','','','MO','2016-05-15 22:28:53','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463412056/nly7yyiaanfurge0vd85.jpg',11,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBABHGwgNwmSnGHCqOkUyBnfyJYVWNSIdfezL6CMZAHenEFiGjZCsZB2ZAmh7KPdkbh2wpepY9fJLLmRV9Qet4KA2VM8FnidM61tCwIdjZAPBCQV01eyjn5YtVzVeoO8ZCZABKfPrMv88LZClIj4BPwYcZD','Martin.Zhivkov','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463412049/llrgvrp7jmo639hhplty.jpg'),(514,'Olavo','de Oliveira Costa Neto',NULL,NULL,'Campo grande - state of mato grosso do sul','Brazil',NULL,NULL,NULL,NULL,NULL,'https://lh3.go