INSERT INTO `project_feedbacks` VALUES (1,3,4,NULL,'Anyone with contact in Shenzen, China ?','',40502,'2016-03-10 22:32:36','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649179/tp4f4nre7dci6xlsvz2l.jpg','creator','Jeanne','Coleman'),(2,9,14,NULL,'Is there anyone willing to join the team as product manager?','PM me for more details.',11285,'2016-03-11 10:50:12','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','creator','Max','Tolkin'),(9,21,7,NULL,'Windows phone users ?','We need to find some windows phone users for feedbacks about the ui/ux. Thanks!',57415,'2016-03-14 15:32:29','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAK8iYOWjLtxPNgMhKLPQm58bqMExrWWwuP2ZAZBfzh5RPn0oMwRTSDANhZB9VkqoX5To2YA5Y9b1eYvGX6JtkPLMdJOoKX9WAUCArwL9MV0mhWGps2jKTRh72qyRMwxqoBIQ4JpsEp9zpyMveIZD','creator','Maxence','Mson'),(10,21,9,NULL,'What is this all about ?',NULL,57415,'2016-03-17 09:57:30','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457688366/nfziqhnsu8123zazvz0w.jpg','project member','Olivier','Hamelin'),(15,57,133,NULL,'Bringing a small tech-toy to mass market?','Does anyone have experience with bringing a small tech gadget to large retailers? I\'ve brought two projects to niche markets, and I would love to discuss bringing a design to a general audience.',69437,'2016-03-23 04:40:09','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458705999/t75lmmi4lg40xsclhnrd.jpg','creator','Jarek','Lupinski'),(27,128,186,NULL,'Which state in the US has the most progressist politicians willing to invest in participatory democracy?','Which state in the US has the most progressist politicians willing to invest in participatory democracy?',95540,'2016-04-29 08:24:06','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461917477/zchgzb7k9pc0ctvyyq8r.jpg','creator','Manu','Musa'),(28,129,7,NULL,'In what store you prefer to use ?','I\'m wondering is wallmart or that kind of store is the best to start.',16029,'2016-04-30 16:02:20','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458587075/ejrk6p8i4fxn8qqfg87l.jpg','creator','Maxence','Mson'),(29,133,241,NULL,'How can i find an associate in programming on witty circle.com ?','Any help please. Thanks',90010,'2016-05-03 11:25:21','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBABFZAYOiScZAX62SCTZABKNzT2bDrr5XXNusZCc1aiZBra9RZADTocgpVZCTFLR6LnRUu8zXX6p6ZCnlHHZAzx3FZBovw8P90NtC5OUNtGuEIjZCn2jKZC0YbCUbx28ZASRmJOqIzJaXTOZBe2ZBgwPiCpfBFQZD','creator','Maximilien','Lejeune'),(30,135,255,NULL,'What do you think about the idea?',NULL,10484,'2016-05-04 12:12:34','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAE8sAAzDZCoSoMl5PF7f4pTOZCgSml3Ax1vYROQ5kE3jMZB9iEINvceyKO7Nmddg9MO0VYGq0n4VAn6Clst7ay19NqvDYmjuyZBXN0v21zw0EsAM9GNTvAcBbetmDqaoBt8kx4wZCQWesweokFbgZD','creator','Lukas','Langhart'),(31,135,255,NULL,'And who would like to help us building the prototype? :)',NULL,10484,'2016-05-04 19:52:24','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAE8sAAzDZCoSoMl5PF7f4pTOZCgSml3Ax1vYROQ5kE3jMZB9iEINvceyKO7Nmddg9MO0VYGq0n4VAn6Clst7ay19NqvDYmjuyZBXN0v21zw0EsAM9GNTvAcBbetmDqaoBt8kx4wZCQWesweokFbgZD','creator','Lukas','Langhart'),(32,138,258,NULL,'Feedback on language learning stories','Hi guys, we\'d love it if you could give any feedback (ideally from children) for our stories that start in English and end in a different language - http://onethirdstories.com/audiobooks/',31647,'2016-05-04 21:50:36','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAJoaormGWRZCm3h1Djvl7ZAhxe14fQHqHVONuwZAwf0rEZBEq6UZBkZANZAZCAvg2W6Tha54XZAywGbDSlsp2QTbZC5bZCBppgZBpNCJqZBopkZCQe00slPKZBwZAZCJZCsYZALKUZC8XixBKej70dZCfU9RtXqUYBGsZD','creator','Alex','Somervell'),(33,138,258,NULL,'Does anyone know any parent bloggers?','Hey! We\'re mainly looking to reach our audience through blogger outreach so we\'re 