reator','Kai','Schmid'),(41,184,539,NULL,'UI/UX Feedback','If you had to change something on the website, regarding the UI/UX, what would it be?',78445,'2016-05-16 16:48:06','https://lh4.googleusercontent.com/-QbTQcj4Nc_w/AAAAAAAAAAI/AAAAAAAAHTc/QdqZfSVIZDM/photo.jpgsz=200','creator','Kevin','Bosc'),(44,159,343,NULL,'Would you accept to pay a small commission when you set up rides with your friends?','This commission is to pay servers, external APIs and integrated payment feature.',26111,'2016-05-17 13:30:13','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463152167/gycyzu9rfjlltrd3lp1j.jpg','creator','Alexandre','Hanot'),(47,53,3,NULL,'sdfsdf','sdfsdf',77941,'2016-05-22 11:10:56','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457648516/tgaugxgkwjzj0ik5bhcu.jpg','creator','Henry','Wei'),(48,125,8,NULL,'sdfsdf','sdfsdf',25450,'2016-05-24 01:01:31','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463276125/eve8apwdglglbbkxypdl.jpg','project member','Jay','Ho'),(49,125,8,NULL,'sddssd','sddsdsdsds',25450,'2016-05-24 01:02:29','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463276125/eve8apwdglglbbkxypdl.jpg','project member','Jay','Ho'),(50,125,8,NULL,'sdfsdf','sdfsdf',25450,'2016-05-24 01:03:29','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463276125/eve8apwdglglbbkxypdl.jpg','project member','Jay','Ho'),(51,125,8,NULL,'sddssd','sddsdsdsds',25450,'2016-05-24 01:04:23','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463276125/eve8apwdglglbbkxypdl.jpg','project member','Jay','Ho'),(52,125,8,NULL,'sdfsdf','sdfsdf',25450,'2016-05-24 01:04:29','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463276125/eve8apwdglglbbkxypdl.jpg','project member','Jay','Ho'),(53,125,8,NULL,'sddssd','sddsdsdsds',25450,'2016-05-24 01:05:29','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463276125/eve8apwdglglbbkxypdl.jpg','project member','Jay','Ho'),(54,125,8,NULL,'sdfsdf','sdfsdf',25450,'2016-05-24 01:06:24','https://res.cloudinary.com/dqpkpmrgk/image/