CREATE TABLE `project_followers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `follow_project_id` int(11) NOT NULL,
  `creation_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `user_name` varchar(128) NOT NULL,
  `follow_project_title` varchar(512) NOT NULL,
  `follow_project_public_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_project_followers_1_idx` (`user_id`),
  KEY `fk_project_followers_2_idx` (`follow_project_id`),
  CONSTRAINT `fk_project_followers_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `fk_project_followers_2` FOREIGN KEY (`follow_project_id`) REFERENCES `projects` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=351 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

