CREATE TABLE `project_openings` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `project_id` int(11) NOT NULL,
  `status` varchar(128) NOT NULL,
  `skill` varchar(128) NOT NULL,
  `description` varchar(512) NOT NULL,
  `picture` varchar(128) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `taggs` varchar(512) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_project_openings_1_idx` (`project_id`),
  CONSTRAINT `fk_project_openings_1` FOREIGN KEY (`project_id`) REFERENCES `projects` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=latin1;
