INSERT INTO `project_openings` VALUES (1,1,'Teammate','Programming','I did all the branding and design of the website but i need to find someone to help me with the code. Sneaker fanatic would be a big plus.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457647970/khzrojhuriq03qe71tk3.jpg','2016-03-10 22:14:03','[\"Javascript\",\"Angular.js\"]'),(2,4,'Mentor','Venture Financing','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457649671/kizncswdexdoqkryxfc6.jpg','2016-03-10 22:42:39','0'),(3,7,'Tips','Programming','We\'re looking to build an online store. Any help would be welcome. :)','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457692081/ujuqfw65cec0k8odp6ty.jpg','2016-03-11 10:29:46','[\"Drupal\",\"WordPress\"]'),(10,21,'Teammate','Javascript','bonjourdsfsdf','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457969236/k4fstru1o2chdkla4jf3.jpg','2016-05-24 02:27:02','[\"Adobe Photoshop\",\"Graphic Design\"]'),(14,29,'Teammate','Product Design','','','2016-04-24 06:44:11','[\"Branding\",\"Graphic Design\"]'),(21,55,'Any help','Product Design','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458586835/i85k7hlipk0wq373ptv2.jpg','2016-03-21 18:59:10','0'),(23,56,'Any help','Product Design','Really keen to get feedback and ideas from real users on how the Build Focus alpha works for them, and changes and tweaks that would help them avoid distraction even better.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458647973/z5iv8etb5ngy6ripuin3.jpg','2016-03-22 12:04:13','0'),(24,56,'Any help','SEO','Build Focus comes up well for searches for its name, but not so much for other related keywords, and it\'s a crowded space. I\'d love some ideas from people with skills in improving that.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458647973/z5iv8etb5ngy6ripuin3.jpg','2016-03-22 12:05:11','0'),(25,56,'Any help','Graphic Design','I\'m not a graphic designer. Build Focus has a lot of art involved, and while I think it\'s reasonably good, it\'s not *great*; I\'d love just thoughts and direction in what I should be working on.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458647973/z5iv8etb5ngy6ripuin3.jpg','2016-03-22 12:05:56','0'),(26,57,'Mentor','Business Angels','I have created and driven two projects to niche markets already, and am seeking a more experienced mentor who could help me realize my goal of getting this gadget into the mass market.','','2016-04-24 06:44:50','[\"Venture Capital\",\"Business Development\",\"Product Management\"]'),(27,59,'Mentor','Advertising Strategy','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458838787/ahudgcyrlyaboomjokzi.jpg','2016-03-25 14:04:31','[\"Communication\"]'),(28,59,'Any help','Marketing Strategy','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458838787/ahudgcyrlyaboomjokzi.jpg','2016-03-25 14:10:28','0'),(33,7,'Mentor','Product Design','Test need','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457692081/ujuqfw65cec0k8odp6ty.jpg','2016-04-18 13:32:16','[\"Javascript\",\"Adobe Photoshop\"]'),(50,13,'Mentor','Graphic Design','Advice in designing our new product would be great','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1457697576/ci2e5te5vsusdnmfofj6.jpg','2016-04-25 11:27:59','0'),(55,125,'Any help','Artificial Intelligence','We are aiming to develop an algorithm which can classify user\'s movements (based on a smartphone\'s motion sensors) into \"normal\" and \"suspicious\" (e.g. falling, being pushed, etc.)','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1461766888/mbllvdqrotykz49004yt.jpg','2016-04-27 14:26:39','0'),(56,125,'Teammate','Android','Our location-based iOS app is almost ready for launch and we had tons of requests for an Android version. We need a teammate which would ideally stay with us.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1461766888/mbllvdqrotykz49004yt.jpg','2016-04-27 14:28:38','0'),(58,128,'Mentor','Public Relations','Need to find a Mayor willing to test a participatory democracy approach to propose sustainable development projects for his/her municipality','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1461917807/e2fsrpxq4xccnlau84eu.jpg','2016-04-29 08:22:52','0'),(59,129,'Teammate','Electrical Engineering','My projects include a kind of a housing for data transfer between the smartphone and the usual checkout','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1462031765/xs0fqteypxbjf0u1v87j.jpg','2016-04-30 16:00:31','[\"Electrical Manufacture\",\"Digital Electronics\"]'),(60,129,'Any help','Product Design','Seeking a designer or any help from a designer to help design the blue print of the box !','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1462031765/xs0fqteypxbjf0u1v87j.jpg','2016-04-30 16:03:35','[\"Industrial Design\"]'),(61,129,'Teammate','Commercial','I need to find my long time partner, it\'s gonna be a long journey','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1462031765/xs0fqteypxbjf0u1v87j.jpg','2016-04-30 16:04:47','[\"Communication\"]'),(62,59,'Teammate','Product Design','From Eyewear World\nUsing raw materials\nRecycled products\nSustainable spirit\nEco-Friendly\nDesign Innovation','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1458838787/ahudgcyrlyaboomjokzi.jpg','2016-05-03 09:59:39','0'),(63,133,'Teammate','Programming','Looking for an associate full time, must be CTO with strong technical background (web & mobile development) and strong marketing / communication skills.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1462274148/xrdbcbgdu22xfmtoryie.jpg','2016-05-03 11:24:34','0'),(64,135,'Any help','Product Design','it\'s about putting glasses into a plastic vizor.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1462386127/gqxt7zapheuebijwmt55.jpg','2016-05-04 18:24:11','0'),(66,135,'Tips','Product Design','Who can help build our prototype?','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1462390645/oaxupqwfip8ioekam9xq.jpg','2016-05-04 19:53:50','0'),(67,136,'Any help','','Any feedback about my project or any comments about the page would be greatly appreciated!','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1456744591/no-bg_k0b9ob.jpg','2016-05-04 20:02:02','0'),(68,159,'Teammate','Growth Hacking','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463152483/cyyxja82wpvlm6kx3gwk.jpg','2016-05-13 15:16:22','0'),(69,162,'Any help','Business Development','As this is a social venture, we need to figure out ways to sustain ourselves and the community.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463236018/uexlmeftkdbtpgmfezy7.jpg','2016-05-14 14:37:03','0'),(70,164,'Any help','Social Media Marketing','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463258616/d7asyx39obsehir4tnwe.jpg','2016-05-14 20:45:19','0'),(71,167,'Any help','','I\'m looking for people who can help shape the vision and get loombrand to the next level. Currently we\'re in a single niche and would like to expand to deeper penetration in more verticals.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463267314/orlaibdahnnn6qx7bbv0.jpg','2016-05-14 23:11:30','0'),(72,168,'Teammate','Product Design','Currently, one of our cofounders manages all design, engineering, and tech responsibilities. We\'re interested in a great product designer to work closely with someone who can take over design.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463277461/fsx9xfxbxtp78btqads5.jpg','2016-05-15 03:02:15','0'),(73,170,'Teammate','Fashion Design','Busco un Fashion Director o Estilista que colabore en un equipo de trabajo sólido y consolidado para realización de editoriales de moda y campañas publicitarias para empresas de moda.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463283042/cyxqfwsdszi1ure4qlkm.jpg','2016-05-15 03:37:37','0'),(74,170,'Teammate','Adobe Photoshop','Busco un retocador que colabore en un equipo de trabajo sólido y consolidado para realización de editoriales de moda y campañas publicitarias para empresas de moda.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463283042/cyxqfwsdszi1ure4qlkm.jpg','2016-05-15 03:38:34','0'),(75,170,'Teammate','SEO','Busco un Community Manager que colabore en un equipo de trabajo sólido y consolidado para realización de editoriales de moda y campañas publicitarias para empresas de moda.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463283042/cyxqfwsdszi1ure4qlkm.jpg','2016-05-15 03:39:19','0'),(76,179,'Any help','Machine Learning','Looking to build a foodie machine learning system.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1456744591/no-bg_k0b9ob.jpg','2016-05-16 03:34:14','0'),(77,177,'Teammate','Social Networking Development','Looking for a mate with marketing skills which can be applied with a small startup budget.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463342114/yuxkpczfmmyanv8wxxog.jpg','2016-05-16 10:42:20','[\"Social Media Marketing\",\"Google analytics\",\"Growth Hacking\"]'),(78,177,'Teammate','iOS','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463342114/yuxkpczfmmyanv8wxxog.jpg','2016-05-16 10:43:37','[\"Programming\",\"MongoDB\"]'),(79,183,'Any help','','diseño de pagina web','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463412592/tytkug5x442kagoctary.jpg','2016-05-16 15:32:34','0'),(80,185,'Tips','Programming','busco alguna ayuda en la programación de la aplicación web','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1456744591/no-bg_k0b9ob.jpg','2016-05-16 16:41:19','0'),(81,184,'Any help','Business Angels','We are opening our seed round and we are looking for some advice from business angels, if possible in the recruiting vertical or social network.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1456744591/no-bg_k0b9ob.jpg','2016-05-16 16:47:14','0'),(82,184,'Mentor','Venture Capital','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1456744591/no-bg_k0b9ob.jpg','2016-05-16 16:47:28','0'),(83,187,'Any help','Product Design','We are looking for feedback for our product and for ways to bring it to the masses, i.e. marketing and sales.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1456744591/no-bg_k0b9ob.jpg','2016-05-16 20:45:17','0'),(84,189,'Teammate','Programming','Mobile web/native app development. Strong experience in back-end database building is also important. I know this is a huge ask!','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463438427/kxgn6lghb0ycnpu1oc2q.jpg','2016-05-16 22:44:04','0'),(85,190,'Tips','','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463448929/sbnhszy7hmqtkrsdvzt1.jpg','2016-05-17 01:40:49','0'),(86,191,'Any help','Programming','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463559250/me0iuvnwqkokzt1olsdp.jpg','2016-05-18 08:47:19','0'),(87,193,'Any help','','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463642469/rkkp8nswytmdj9qbk4ov.jpg','2016-05-19 07:22:19','0'),(88,57,'Any help','Photography','I have a few working beta units, and I\'d be happy to send one to someone for free in exchange for high-quality photographs of MySeer that I can post up here.','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1463674536/gsshpmk1